INSERT INTO `#__cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2014-09-19 11:14:00', '2014-09-19 11:14:02', 1),
(2, 'Footer Links Company', 'footer_links_company', '\n<div class="links">\n    <div class="block-title">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\n        <li><a href="{{store url=""}}contacts/">Contact Us</a></li>\n        <li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\n        <li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\n    </ul>\n</div>', '2014-09-19 11:14:02', '2014-09-19 11:14:02', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2014-01-23 20:18:19', '2015-05-14 00:05:36', 1),
(8, 'footer map', 'footer-map', '{{block type="core/template" name="footer.map" before="-" template="contacts/form_location.phtml"/ }}', '2015-01-08 15:48:15', '2015-01-08 15:48:15', 1),
(9, 'Social', 'social', '<ul class="social">\r\n<li class="over social-facebook"><a title="Facebook" href="#"> <em class="rhb fa fa-facebook">&nbsp;</em> <span>Facebook</span> </a></li>\r\n<li class="over social-twitter"><a title="Twitter" href="#"> <em class="rhb fa fa-twitter">&nbsp;</em> <span>Twitter</span> </a></li>\r\n<li class="over social-google"><a title="Google" href="#"> <em class="rhb fa fa-google-plus">&nbsp;</em> <span>Google+</span> </a></li>\r\n<li class="over social-pin"><a title="Pinterest" href="#"> <em class="rhb fa fa-pinterest">&nbsp;</em> <span>Pinterest</span></a></li>\r\n<li class="over social-rss"><a title="Twitter" href="#"> <em class="rhb fa fa-rss">&nbsp;</em> <span>RSS</span> </a></li>\r\n</ul>', '2015-01-08 17:53:48', '2015-03-10 02:41:07', 1),
(10, 'Footer Links', 'footer-links', '<ul class="footer-links">\r\n<li><a title="Privacy Policy" href="privacy-policy-cookie-restriction-mode">Privacy Policy</a></li>\r\n<li><a title="Site Map" href="#">Site Map</a></li>\r\n</ul>', '2015-01-08 17:56:40', '2015-03-10 03:33:18', 1),
(11, 'Content Showcase', 'content-showcase', '<div class="row no-margin">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-12 no-padding a-right"><img alt="" src="{{media url="wysiwyg/showcase/default_banner4.jpg"}}" />\r\n<div class="abs-left">\r\n<h3>Investigationes demons tra-verunt lectores claritas est</h3>\r\n<div class="line">&nbsp;</div>\r\n<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut</p>\r\n<a class="see-more" href="about-magento-demo-store"><span>SEE MORE</span><i class="rhb fa fa-long-arrow-right">&nbsp;</i></a></div>\r\n</div>\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-12 no-padding a-left"><img alt="" src="{{media url="wysiwyg/showcase/default_banner3.jpg"}}" />\r\n<div class="abs-right">\r\n<h3>Lorem ipsum dolor sit amet consectetuer</h3>\r\n<div class="line">&nbsp;</div>\r\n<p>Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea</p>\r\n<a class="see-more" href="about-magento-demo-store"><span>SEE MORE</span><i class="rhb fa fa-long-arrow-right">&nbsp;</i></a></div>\r\n</div>\r\n</div>', '2015-01-12 11:30:16', '2015-02-10 01:39:10', 1),
(12, 'Block Showcase', 'block-showcase', '<div class="row custom-text no-margin">\r\n<div class="col-xs-12 col-lg-4 col-sm-4 col-4">\r\n<div class="item"><span class="icon pull-left"><img alt="" src="{{media url="wysiwyg/showcase/icon-gold.png"}}" /></span>\r\n<h3>SHIPPING WORLDWIDE</h3>\r\n<p>On orders over $399.0</p>\r\n</div>\r\n</div>\r\n<div class="col-xs-12 col-lg-4 col-sm-4 col-4">\r\n<div class="item"><span class="icon pull-left"><img alt="" src="{{media url="wysiwyg/showcase/icon-box.png"}}" /></span>\r\n<h3>FREE RETURN</h3>\r\n<p>On orders over $399.0</p>\r\n</div>\r\n</div>\r\n<div class="col-xs-12 col-lg-4 col-sm-4 col-4">\r\n<div class="item"><span class="icon pull-left"><img alt="" src="{{media url="wysiwyg/showcase/icon-support.png"}}" /></span>\r\n<h3>SUPPORT 24/7</h3>\r\n<p>Hotline: (+91) 0123 456 789</p>\r\n</div>\r\n</div>\r\n</div>', '2015-01-21 12:18:56', '2015-01-21 14:58:36', 1),
(13, 'Footer Contact', 'footer-contact', '{{block type="core/template" name="footer.contact" before="-" template="contacts/form_contact.phtml"/ }}', '2015-01-21 17:31:12', '2015-01-21 17:31:12', 1),
(14, 'Hotline', 'hotline', '<div class="a-right"><img src="{{media url="wysiwyg/showcase/phone.png"}}" alt="" /> Hotline: (+01) - <b>000 222 666</b> / (+01) <b>000 111 999</b></div>', '2015-01-21 17:40:00', '2015-01-21 18:27:42', 1),
(15, 'Langding Page', 'langding-page', '<div>{{block type="ves_landingpage/list" name="ves_landingpage.list" before="-" /}}</div>', '2015-01-24 18:01:22', '2015-02-11 03:05:44', 1),
(16, 'Call Us', 'call-us', '<p><i class="fa fa-phone">&nbsp;</i><span>CALL US: (+01) - </span>222 000 666 . Free shipping on order over $99 !.</p>', '2015-01-26 10:57:30', '2015-03-14 02:15:36', 1),
(17, 'Newletter Module', 'newletter', '{{block type="newsletter/subscribe" template="newsletter/subscribe.phtml"}}', '2015-01-27 10:37:49', '2015-01-27 10:37:49', 1),
(18, 'Customer Service', 'customer-service', '<div class="block-title"><span>Customer Service</span></div>\r\n<div class="block-content">\r\n<ul class="links">\r\n<li><a title="Site Map" href="catalog/seo_sitemap/category/">Site Map</a></li>\r\n<li><a title="Search Terms" href="catalogsearch/term/popular/">Search Terms</a></li>\r\n<li><a title="Advanced Search" href="catalogsearch/advanced/">Advanced Search</a></li>\r\n<li><a title="Orders and Returns" href="sales/guest/form/">Orders and Returns</a></li>\r\n<li><a title="Contact Us" href="contacts/">Contact Us</a></li>\r\n</ul>\r\n</div>', '2015-05-14 00:05:37', '2015-05-14 00:05:37', 1),
(19, 'About Us', 'about-us', '<div class="block-title"><span>About Us</span></div>\r\n<div class="block-content">\r\n<ul class="links">\r\n<li><a href="#">Responsive</a></li>\r\n<li><a href="#">Magento themes</a></li>\r\n<li><a href="#">E-commerce</a></li>\r\n<li><a href="#">The company</a></li>\r\n<li><a href="#">Terms</a></li>\r\n</ul>\r\n</div>', '2015-05-14 00:05:37', '2015-05-14 00:05:37', 1),
(20, 'block-load-theme', 'block-load-theme', '<div class="block-load-theme popup-bg">\r\n<div class="popup-content pull-left">\r\n<h2>SUBSCRIBE TO OUR NEWSLETTERS</h2>\r\n<div class="bg-white">&amp;</div>\r\n<strong>GET <span>10%</span> OFF</strong>\r\n<h5>APPLY FOR NEXT PURCHASE</h5>\r\n{{block type="newsletter/subscribe" template="newsletter/subscribe.phtml"}}</div>\r\n</div>', '2015-05-14 00:05:37', '2015-06-17 01:57:36', 1),
(21, 'Pretext categories list', 'categories-list-pretext', '<div class="pretext"><p>This is Photoshop''s version of Lorem Ipsum. Proin gravida nibh vel velit auctor aliquet aenean.</p> <a class="see-all" href="watch.html"> See all <i class="fa fa-long-arrow-right">&nbsp;</i> </a></div>', '2015-05-14 00:05:38', '2015-05-21 20:00:27', 1),
(22, 'Header verticalmenu', 'header-verticalmenu', '{{block type="ves_verticalmenu/top" name="ves.verticalmenu"}}', '2015-05-14 00:05:38', '2015-05-14 00:21:36', 1);
