INSERT INTO `#__ves_blog_post` (`post_id`, `is_active`, `title`, `identifier`, `description`, `detail_content`, `created`, `updated`, `user_id`, `update_user`, `meta_keywords`, `meta_description`, `position`, `tags`, `file`, `category_id`, `hits`, `video_id`, `video_type`) VALUES
(7, 1, 'VesTheme', 'ves-theme', '<p>VesTheme Control Panel is the module on Magento Theme. That is a the most important module to control your theme.</p>', '<p>VesTheme Control Panel is the module on Magento Theme. That is a the most important module to control your theme. It can help you customize,configure your theme very easily and flexiblely, you can make a</p>\r\n<p>new nices theme as expected in very short time. In this blog post, we would like to guide you how to configure VesTheme Control Panel In Opencart Shop. We will use Pav Foodstore Opencart theme - a great responsive Magento theme provided by Venustheme like example.</p>\r\n<p>VesTheme Control Panel is the module on Magento Theme. That is a the most important module to control your theme. It can help you customize,configure your theme very easily and flexiblely, you can make a new nices theme as expected in very short time. In this blog post, we would like to guide you how to configure VesTheme Control Panel In Opencart Shop. We will use Pav Foodstore Opencart theme - a great responsive Magento theme provided by Venustheme like example.</p>\r\n<p>VesTheme Control Panel is the module on Magento Theme. That is a the most important module to control your theme. It can help you customize,configure your theme very easily and flexiblely, you can make a new nices theme as expected in very short time. In this blog post, we would like to guide you how to configure VesTheme Control Panel In Opencart Shop. We will use Pav Foodstore Opencart theme - a great responsive Magento theme provided by Venustheme like example.</p>', '2015-04-02 19:49:58', '2015-04-02 19:49:58', 1, '', '', '', 1, 'magento, VesTheme', 'blog/blog-1.jpg', 5, 0, NULL, '-1'),
(8, 1, 'Kitchen', 'kitchen', '<p>Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML</p>', '<p>Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML, Video Image as layer to play on each slider. You can add unlimited menu item,column,row each menu can include image, video, text ...</p>\r\n<p>Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML, Video Image as layer to play on each slider. You can add unlimited menu item,column,row each menu can include image, video, text ...Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML, Video Image as layer to play on each slider. You can add unlimited menu item,column,row each menu can include image, video, text ...</p>\r\n<p>Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML, Video Image as layer to play on each slider. You can add unlimited menu item,column,row each menu can include image, video, text ...</p>\r\n<p>Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML, Video Image as layer to play on each slider. You can add unlimited menu item,column,row each menu can include image, video, text ...</p>\r\n<p>Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML, Video Image as layer to play on each slider. You can add unlimited menu item,column,row each menu can include image, video, text ...Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML, Video Image as layer to play on each slider. You can add unlimited menu item,column,row each menu can include image, video, text ...</p>', '2015-04-02 19:50:13', '2015-04-02 19:50:13', 1, '', '', '', 2, 'ves, megamenu', 'blog/blog-2.jpg', 5, 18, NULL, '-1'),
