(11, 1, 'Tabletop', 'tabletop', '<p>Magento provides different payment methods in order to allow you to accept payments using different payment processors like Paypal...</p>', '<p>Magento provides different payment methods in order to allow you to accept payments using different payment processors like Paypal, Authorize.net and many more. The clients can also pay through regular credit cards like Visa, Master Card, American Express, Discover, Switch/Solo, check/money orders and other payment solutions.</p>\r\n<p>Magento provides different payment methods in order to allow you to accept payments using different payment processors like Paypal, Authorize.net and many more. The clients can also pay through regular credit cards like Visa, Master Card, American Express, Discover, Switch/Solo, check/money orders and other payment solutions. Enable the method, enter its title, set the new order status, pick the supported credit cards, decide whether the credit card verification is required, define from which countries to accept payments and the range of the accepted payments.</p>\r\n<p>In the Sort order field you should enter the position of this payment method compared to the other payment methods offered to the customers. That''s it, you have just enabled this payment method for your customers. Since all payment methods have different configurations, we cannot explain in details how to configure each one of them. Simply follow the instructions on their specific pages and they should work.</p>', '2015-04-02 19:59:46', '2015-04-02 19:59:46', 1, '', '', '', 4, 'magento, payment', 'blog/blog-5.jpg', 5, 8, NULL, '-1'),
