(13, 1, 'Venustheme', 'venustheme', '<p>CMS (Content Management System) pages are static pages such as your Homepage, About Us, and Customer Service pages</p>', '<p>In this tutorial, we will use Magento&rsquo;s powerful shipping-method code abstraction to create a shipping carrier. We will create three shipping methods that provide a fixed shipping price, allow for free shipping promotions, define logic based on an item&rsquo;s weight and, finally, make it all configurable in the admin panel.<br /><br />In this tutorial, we will use Magento&rsquo;s powerful shipping-method code abstraction to create a shipping carrier. We will create three shipping methods that provide a fixed shipping price, allow for free shipping promotions, define logic based on an item&rsquo;s weight and, finally, make it all configurable in the admin panel.<br />In this tutorial, we will use Magento&rsquo;s powerful shipping-method code abstraction to create a shipping carrier. We will create three shipping methods that provide a fixed shipping price, allow for free shipping promotions, define logic based on an item&rsquo;s weight and, finally, make it all configurable in the admin panel.<br /><br />In this tutorial, we will use Magento&rsquo;s powerful shipping-method code abstraction to create a shipping carrier. We will create three shipping methods that provide a fixed shipping price, allow for free shipping promotions, define logic based on an item&rsquo;s weight and, finally, make it all configurable in the admin panel.<br />In this tutorial, we will use Magento&rsquo;s powerful shipping-method code abstraction to create a shipping carrier. We will create three shipping methods that provide a fixed shipping price, allow for free shipping promotions, define logic based on an item&rsquo;s weight and, finally, make it all configurable in the admin panel.</p>', '2015-04-02 20:00:33', '2015-04-02 20:00:33', 1, '', '', '', 7, 'magento pages', 'blog/blog-7.jpg', 5, 4, NULL, '-1');
